import {FixedStats as FixedStats} from "../Datas/Stats";

export function OcrRetouch({text, lang}) {
  if (!text) return [];
  if (!lang) lang = "en";

  var datas = text
    .split(/\r?\n/)
    .map((line) => line.trim())
    .filter((line) => line);

    for (var i = 0; i < datas.length; i++){
        print(datas[i]);
        try {
            FixedStats.find((e) => e[lang] === datas[i])
        }
        catch{ continue; }
    }
}
